INSERT INTO `template_items` VALUES ('13', '1', '<p class=\"MsoNormal\" dir=\"RTL\" style=\"text-align: center;\"><b><span lang=\"AR-EG\" style=\"font-size:14.0pt\">\n    <u>البند العاشر<o:p></o:p></u></span></b>\n    </p>\n\n    <p class=\"MsoNormal\" dir=\"RTL\" style=\"margin-right:-1.15pt\"><span lang=\"AR-SA\" style=\"font-size:14.0pt;mso-bidi-language:AR-SA;mso-no-proof:no\">يخضع هذا العقد\n    لأحكام القوانين ونظام المحاكم المعمول بهما في جمهورية مصر العربية.</span></p>', '2018-11-12 15:14:58', '2018-11-12 20:32:22');
INSERT INTO `template_items` VALUES ('14', '1', '<blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\"><p dir=\"RTL\" style=\"text-align: center; margin: 0in 82.45pt 2pt 0in;\"><b><u><span style=\"font-size:\n    14.0pt\">البند الحادى عشر</span></u></b></p></blockquote>\n\n    <p dir=\"RTL\" style=\"margin-right:-1.15pt\"><span style=\"font-size:14.0pt;\">حرر هذا العقد\n    من نسختين أصليتين بيد كل طرف نسخة  و\n    النسخه مكونه من ثلاث ورقات للعمل بها عند الحاجة.<o:p></o:p></span></p>\n\n    <p dir=\"RTL\" style=\"margin-right:-1.15pt\"><span lang=\"AR-SA\" style=\"font-size:14.0pt;\"><o:p> </o:p></span></p>', '2018-11-12 15:15:18', '2018-11-12 20:34:07');
